INSERT INTO `t_km_inforecord` VALUES ('13', '2012-02-29 22:04:02', '2012-02-29 22:04:02', '由于自己的考虑不周全，虚拟桌面的失败，自己应用负全责。虽然说内外很多原因，自己也欠缺经验，然而这些都不是值口。自己要做的是好好承认错误，在工作中吸取教训，做事要想周全，每个方面要细致处理，确保方向不偏，环节不犯错误。', 'oliver', '8', '失败的教训');
INSERT INTO `t_km_inforecord` VALUES ('14', '2012-03-02 21:40:24', '2012-03-02 21:40:39', '虚拟桌面的错误，说明在犯错中谁都不能救自己，除了自己。一直在以前岗位做事，从来没有考虑过这种境况。客户在政治立场永远不会和你在一阵线，领导想和一起，在错误面前他们也只能断臂。所以说，无论何时，也只有自己才能救自己。', 'oliver', '8', '工作中也是只有自己才能拯救自己');
INSERT INTO `t_km_inforecord` VALUES ('15', '2012-03-02 23:04:59', '2012-03-02 23:04:59', '考勤需求', 'oliver', '6', '考勤');
INSERT INTO `t_km_inforecord` VALUES ('16', '2012-03-04 19:51:05', '2012-03-04 20:02:43', '对于框架的结构需要清楚，机制要理解。对于框架的清楚，是使用框架的前提条件，就是对于全个框架需要一个整体的理解。\r\n\r\n核心思想，机制和应用场景，这是学习的三个要素，此为技术学习的基本。', 'oliver', '9', '框架学习模式');
